import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  root: {
    width: 450,
    marginTop: theme.spacing(3),
  },
  titulo: {
  	textAlign: 'center',
  	marginTop: theme.spacing(2),
  },
  subtitulo: {
  	color: 'gray',
  	textAlign: 'center',
  	fontSize: 14
  },
  icono: {
  	display: 'block',
  	width: 100,
  	margin: '10px auto'
  },
  button: {
  	display: 'block',
  	marginTop: theme.spacing(3), 
  	margin: 'auto',
  }
}))
